import React, { useEffect, useState, useRef } from 'react';

import CustomExpandedBox from '../customExpandedBox';
/**
 * @file module:src/components/ExtendedLine/index.jsx  
 * @param {*} props
 * @param {number} props.index -   
 * @returns 
 */

export default function ExtendedTableRow(props){  
    return (   
        <div style={style.container}>
            <CustomExpandedBox
            boxWidth="20%"
            bgColor= "#ffb5bc"
            boxTitle= "Acesso do Usuário"
            boxHeight = "cacl(100% / 4)"
            fieldsList = {[{label: "Rede",fieldKey: "user_access_business_technoloy"}]}
            fieldValues = {{}}

            />
               
            <CustomExpandedBox
            boxWidth="20%"
            bgColor= "#ffb5bc"
            boxTitle= "Endereço do Usuário"
            boxHeight = "cacl(100% / 4)"
            fieldsList = {[{label: "Endereco",fieldKey: "user_access_business_technoloy"}]}
            fieldValues = {{}}

            /> 
 
            <CustomExpandedBox
            boxWidth="20%"
            bgColor= "#ffb5bc"
            boxTitle= "Emprego do Usuário"
            boxHeight = "cacl(100% / 4)"
            fieldsList = {[{label: "Rede",fieldKey: "user_access_business_technoloy"}]}
            fieldValues = {{}}


            /> 
 
            <CustomExpandedBox
            boxWidth="20%"
            bgColor= "#ffb5bc"
            boxTitle= "Produto comprado"
            boxHeight = "cacl(100% / 4)"
            fieldsList = {[{label: "Rede",fieldKey: "user_access_business_technoloy"}]}
            fieldValues = {{}}

            /> 
            
        </div>
    )
}


const style = {
    container: {
        width: "100%",
        height: "100%"
    }
    

};
